'/* ===== Dashboard Wrapper ===== */',
'.pm-dashboard {',
'  display: grid;',
'  grid-template-columns: repeat(auto-fit, minmax(220px, 1fr));',
'  gap: 16px;',
'}',
'',
'/* ===== Card ===== */',
'.pm-dashboard .kpi-card {',
'  display: flex;',
'  align-items: center;',
'  padding: 18px;',
'  border-radius: 10px;',
'  color: #ffffff;',
'  box-shadow: 0 2px 6px rgba(0,0,0,.06);',
'}',
'',
'/* ===== Icon ===== */',
'.pm-dashboard .kpi-icon {',
'  font-size: 24px;',
'  margin-right: 14px;',
'  opacity: 0.85;',
'}',
'',
'/* ===== Text ===== */',
'.pm-dashboard .kpi-value {',
'  font-size: 24px;',
'  font-weight: 600;',
'}',
'',
'.pm-dashboard .kpi-label {',
'  font-size: 13px;',
'  opacity: 0.9;',
'}',
'',
'/* ===== SOFT PROFESSIONAL COLORS ===== */',
'.pm-dashboard .kpi-blue {',
'  background: #141515;',
'}',
'',
'.pm-dashboard .kpi-green {',
'  background: #141515; ',
'}',
'',
'.pm-dashboard .kpi-brown {',
'  background: #141515; ',
'}',
''))
