,p_protection_level=>'C'
,p_page_component_map=>'13'
);
wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(126354678357577538225)
,p_plug_name=>'Dashboard'
,p_region_template_options=>'#DEFAULT#:t-Region--scrollBody'
,p_plug_template=>4072358936313175081
,p_plug_display_sequence=>30
,p_location=>null
,p_function_body_language=>'PLSQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'   l_html CLOB := ''<div class="pm-dashboard">'';',
'BEGIN',
'   FOR r IN (',
'       SELECT ''Total Crimes'' AS label,',
'              COUNT(*) AS value,',
'              ''fa-users'' AS icon,',
'              ''kpi-blue'' AS css',
'         FROM crime',
'       UNION ALL',
'       SELECT ''Projects'',',
'              COUNT(*),',
'              ''fa-briefcase'',',
'              ''kpi-green''',
'         FROM project',
'       UNION ALL',
'       SELECT ''Volunteers'',',
'              COUNT(*),',
'              ''fa-user-friends'',',
'              ''kpi-brown''',
'         FROM volunteer',
'   ) LOOP',
'      l_html := l_html || ',
'         ''<div class="kpi-card '' || r.css || ''">',
'             <div class="kpi-icon">',
'                 <i class="fa '' || r.icon || ''"></i>',
'             </div>',
'             <div class="kpi-content">',
'                 <div class="kpi-value">'' || r.value || ''</div>',
'                 <div class="kpi-label">'' || r.label || ''</div>',
'             </div>',
'         </div>'';',
'   END LOOP;',
'',
'   l_html := l_html || ''</div>'';',
'   RETURN l_html;',
'END;',
'',
'',
'',
'',
''))
,p_lazy_loading=>false
,p_plug_source_type=>'NATIVE_DYNAMIC_CONTENT'
);
